import "./Expenses.css";
import Card from "../UI/Card";
import ExpenseItem from "./ExpenseItem";

function Iterate(params) {
  const entries = [];
  params.forEach((element) => {
    entries.push(
      <ExpenseItem
        title={element.title}
        amount={element.amount}
        date={element.date}
      ></ExpenseItem>
    );
  });
  console.log("CYKA B");
  console.log(entries);
  return entries;
}

function Expenses(props) {
  return <Card className="expenses">{Iterate(props.list)}</Card>;
}

export default Expenses;
